    false,nt"url": null,nt"notes": "FY 2011 Digital Orthophotography (B089)
    Pinellas Co. Fl. under Purchace Order # 11POSOW020. Provide new high resolution
    6" pixel four band stack RGBI digital orthophotos of approximately 460sq. miles
    in Pinellas Co., Fl. This project is a cooperative effort between SWFMD and Pinellas
    Co. New aerial digital photography will be taken with a Vexcel UltraCamX digital
    aerial sensor using 60% forward and 40% sidelap producing a 5.5inch raw pixel while
    covering 513 5000ft. x 5000ft. SWFWMD cells. Flights are to begin Dec. 1st, 2010
    and be completed by Dec. 31st, 2010. Photography must be taken during 30degree sun
    angle and be free of smoke and clouds. Oblique photography will also be obtained
    to produce a 4inch pixel oblique product of the county. Final project deliverables
    will be in both NAD83 and NAD27. All work will be under the supervision of a licensed
    Florida Professional Surveyor and Mapper. Orthophotos will meet or exceed a verified
    horizontal accuracy of 3.46ft. at the 95% confidence interval (2.0 feet RMSE) as
    specified in the FGDC standards. Thirty independent check points will be surveyed
    and used to verify accuracy. No correction for building lean is required.",nt"owner_org":
